customShader:
kernel void customBrushShader(
  constant Dab *dabArray [[ buffer(0) ]],
  constant DabMeta *dabMeta [[ buffer(1) ]],
  texture2d_array <half, access::read_write> activeLayer [[texture(0)]],
  texture2d_array <half, access::read> smudgeBuckets [[texture(1)]],
  texture2d_array <half, access::read> lowerLayer [[texture(2)]],
  texture2d_array <half, access::sample> activeLayerSampler [[texture(3)]],
  uint2 gid [[thread_position_in_grid]],
  uint tid [[thread_index_in_threadgroup]])
  {

    half4 dstA = activeLayer.read(gid, 0);
    half4 dstB = activeLayer.read(gid, 1);
    half4 dstC = activeLayer.read(gid, 2);
    half4 dstMeta = activeLayer.read(gid, 3);

int dabCount = dabMeta->dabCount;
    for (int dabIndex=0; dabIndex < dabCount; dabIndex++) {

float2 center = (dabArray[dabIndex].pos);
    // translate the position using the global texOrigin coordinates
    half xOffset = half(gid.x) + dabMeta->texOrigin.x - center.x;
    half yOffset = half(gid.y) + dabMeta->texOrigin.y - center.y;

    half radius = dabArray[dabIndex].radius;
    half hardness = dabArray[dabIndex].hardness;

    half strength = dabArray[dabIndex].strength;

    half dist = drawEllipseForDab(center, dabArray, dabMeta, gid, dabIndex, radius, xOffset, yOffset);
     if (dist > 1.0 || dist < 0.0 || isnan(dist)) return;
    // otherwise, use the distance to adjust strength to fade out w/ hardness parameter
    dist = pow(dist, half(30.0) * hardness);
    strength *= (1.0 - dist);

        half colorJitterChance = rand(yOffset + tid, xOffset + tid, dabMeta->randomSeeds.w);
        half colorJitter = dabArray[dabIndex].colorJitter;
        half valueJitter =  dabArray[dabIndex].valueJitter;

        if (valueJitter < 0.0 ) {
                valueJitter = -valueJitter;
                valueJitter = pow(1.0 - valueJitter, 4.0);
                for (uint i=0; i < 4; i++) {
                    dstA[i] = (1.0 - strength) * dstA[i] + strength * max(EPSILON_LOG, dstA[i] / (max(rand(yOffset + tid, xOffset + tid, dabMeta->randomSeeds.x), valueJitter)));
                    dstB[i] = (1.0 - strength) * dstB[i] + strength * max(EPSILON_LOG, dstB[i] / (max(rand(yOffset + tid, xOffset + tid, dabMeta->randomSeeds.y), valueJitter)));
                    dstC[i] = (1.0 - strength) * dstC[i] + strength * max(EPSILON_LOG, dstC[i] / (max(rand(yOffset + tid, xOffset + tid, dabMeta->randomSeeds.z), valueJitter)));

                }
            } else {
                valueJitter = pow(1.0 - valueJitter, 4.0);

               // for (uint i=0; i < 4; i++) {
                    dstA = (1.0 - strength) * dstA + strength * dstA * max(rand(yOffset + tid, xOffset + tid, dabMeta->randomSeeds.x), valueJitter);
                    dstB = (1.0 - strength) * dstB + strength * dstB * max(rand(yOffset + tid, xOffset + tid, dabMeta->randomSeeds.y), valueJitter);
                    dstC = (1.0 - strength) * dstC + strength * dstC * max(rand(yOffset + tid, xOffset + tid, dabMeta->randomSeeds.z), valueJitter);
               // }
            }


        //dstA = (1.0 - strength) * dstA + strength * dstA * max(rand(yOffset + tid, xOffset + tid, dabMeta->randomSeeds.x), colorJitter);
        //dstB = (1.0 - strength) * dstB + strength * dstB * max(rand(yOffset + tid, xOffset + tid, dabMeta->randomSeeds.y), colorJitter);
         //dstC = (1.0 - strength) * dstC + strength * dstC * max(rand(yOffset + tid, xOffset + tid, dabMeta->randomSeeds.w), colorJitter);

        uint iterations = 1;


if (colorJitter > 0.0) {

                half invColorJitter = 1.0 - colorJitter;
                 half rand1 = max(rand(yOffset + tid, xOffset + tid, dabMeta->randomSeeds.x), colorJitter);
        half rand2 = max(rand(yOffset + tid, xOffset + tid, dabMeta->randomSeeds.y), colorJitter);
        half rand3 = max(rand(yOffset + tid, xOffset + tid, dabMeta->randomSeeds.z), colorJitter);
                for (uint iter = 0; iter < iterations; iter++) {
                    for (uint i=0; i < 3; i++) {
                        dstA[i] = dstA[i] * (1.0 - colorJitter * rand1) + colorJitter * dstA[i + 1] * rand1;
                        dstB[i] = dstB[i] * (1.0 - colorJitter * rand2) + colorJitter * dstB[i + 1] * rand2;
                        dstC[i] = dstC[i] * (1.0 - colorJitter * rand3) + colorJitter * dstC[i + 1] * rand3;
                    }
                    dstA[3] = dstA[3] * (1.0 - colorJitter * rand1) + colorJitter * dstB[0] * rand1;
                    dstB[3] = dstB[3] * (1.0 - colorJitter * rand2) + colorJitter * dstC[0] * rand2;
                    dstC[3] = dstC[3] * (1.0 - colorJitter * rand3) + colorJitter * dstA[0] * rand3;
                }

            } else if (colorJitter < 0.0) {
                colorJitter = -colorJitter;

half rand1 = max(rand(yOffset + tid, xOffset + tid, dabMeta->randomSeeds.x), colorJitter);
        half rand2 = max(rand(yOffset + tid, xOffset + tid, dabMeta->randomSeeds.y), colorJitter);
        half rand3 = max(rand(yOffset + tid, xOffset + tid, dabMeta->randomSeeds.z), colorJitter);

                half invColorJitter = 1.0 - colorJitter;

                for (uint iter = 0; iter < iterations; iter++) {
                    for (uint i=3; i > 0; i--) {
                        dstA[i] = dstA[i] * (1.0 - colorJitter * rand1) + colorJitter * dstA[i - 1] * rand1;
                        dstB[i] = dstB[i] * (1.0 - colorJitter * rand2) + colorJitter * dstB[i - 1] * rand2;
                        dstC[i] = dstC[i] * (1.0 - colorJitter * rand3) + colorJitter * dstC[i - 1] * rand3;
                    }
                    dstA[0] = dstA[0] * (1.0 - colorJitter * rand1) + colorJitter * dstC[3] * rand1;
                    dstB[0] = dstB[0] * (1.0 - colorJitter * rand2) + colorJitter * dstA[3] * rand2;
                    dstC[0] = dstC[0] * (1.0 - colorJitter * rand3) + colorJitter * dstB[3] * rand3;
                }
            }


}

if (any(isnan(dstA)) || any(isnan(dstA))
        || any(isinf(dstB)) || any(isinf(dstB))
        || any(isinf(dstC)) || any(isinf(dstC))
        || any(isinf(dstMeta)) || any(isinf(dstMeta))
        ) {
        return;
    }

activeLayer.write(dstA, gid, 0);
    activeLayer.write(dstB, gid, 1);
    activeLayer.write(dstC, gid, 2);
    activeLayer.write(dstMeta, gid, 3);

}
